INSERT INTO `answers` (`answer_id`, `post_id`, `timeadded`, `timeedited`, `user_id`, `content`) VALUES
(293, 494, 1409140006, 0, 21, 'Идеята ви е супер'),
(294, 532, 1409145299, 0, 20, 'Зависи с каква цел го създаваш този блог. Ако имаш опит, идея и знаеш как да я реализираш - наеми копирайтър, който да пише качествени статии на английски. Ако искаш да се учиш и експериментираш, то по-добрия вариант е да е на български. Така ще намалиш разходите, а ефектът ще е същия. След като вече имаш опит и идея как да имаш приходи от подобен блог може да си позволиш да инвестираш в създаването му на англисйки език. Също така след като имаш вече български блог със същата идея и статии можеш да преведеш авторските статии от български на английски език и да ги ползваш в новия блог, което ще смъкне малко разходите.'),
(295, 532, 1409145312, 0, 20, 'По темата не не си струва.\nЩо ли? Амчи ти едно заглавие на темата не можа да измислиш, кво остава за блог да поддържаш.\nЕдин жокер:\nСтрува ли си да се прави блог на български език?'),
(296, 532, 1409145331, 0, 21, 'Ако го правиш за лична изява и като хооби- да струва си.\nНо ако се ндяваш на големи печалби и то от блог на бг... забрави : '),
(297, 532, 1409145349, 0, 20, 'Здравей и добре дошъл при нас.  Малко обогатих заглавието на темата, за да ставя ясно за какво е. \n\nЩе ти кажа да стартираш блог на БГ, поне за да се научиш. После може да поработиш върху езика и след време да пуснеш и един за чужбина, но ако си попаднал на една тема тук за един Ен блог, там с трафик около 5-6К на ден правиш по 100 лева на ден. Тук с този трафик едва ли ще е повече от 20 лева.  Просто такъв е пазара, рекламодателите са убедени, че все още е по-добре да наливат в ТВ и пресата. И явно не взимат много на сериозно Интернет. И за това и така. В чужбина всяка голяма и не само фирма се мъчи да позиционира бизнеса си оналйн, защото знае каква възвращаемост нови това за тях.  \n\nАко някой от форума с голям сайт и ADSense може да сподели някакви приблизителни числа, може и да те мотивира, но ще трябва да носи блога доста трафик. За по-малко от 5К на ден не мисля, че си струва. НО не мога да кажа със сигурност.'),
(298, 532, 1409145352, 0, 21, 'Здравей и добре дошъл при нас. Малко обогатих заглавието на темата, за да ставя ясно за какво е.\n\nЩе ти кажа да стартираш блог на БГ, поне за да се научиш. После може да поработиш върху езика и след време да пуснеш и един за чужбина, но ако си попаднал на една тема тук за един Ен блог, там с трафик около 5-6К на ден правиш по 100 лева на ден. Тук с този трафик едва ли ще е повече от 20 лева. Просто такъв е пазара, рекламодателите са убедени, че все още е по-добре да наливат в ТВ и пресата. И явно не взимат много на сериозно Интернет. И за това и така. В чужбина всяка голяма и не само фирма се мъчи да позиционира бизнеса си оналйн, защото знае каква възвращаемост нови това за тях.\n\nАко някой от форума с голям сайт и ADSense може да сподели някакви приблизителни числа, може и да те мотивира, но ще трябва да носи блога доста трафик. За по-малко от 5К на ден не мисля, че си струва. НО не мога да кажа със сигурност. '),
(299, 532, 1409145370, 0, 20, 'Ясно, благодаря за отговорите. А uphero оценявам това, че мина директно на темата, но не смятам, че ти си човекът, който може да прецени какво мога и какво не ; ) Айде със здраве'),
(300, 532, 1409145374, 0, 21, 'Напротив, прав е човека - ти едно заглавие не можеш да измислиш, а си тръгнал да правиш блог, и то на български?! Провала ти е сигурен! '),
(301, 532, 1409145381, 0, 20, 'Имам лошия навик да не премълчавани нищо, тъй съм и офлайн тъй съм и тука. На,някой може и да му пречи ама това положението.\nНещата трябва да се казват с истинските им имена. Не одобрявам хора които само за да се харесат си премълчават.\nА колкото до автора на темата сигур мой съм баща (на години де да не си помислите нещо друго).\nПък и щом пита ще споделя и моето мнение.\nАко,нацели нишатА може да вади повече пари и от EN блог.\nВсичко е въпрос на късмет и внимателно планиране и най вече опит, който явно няма.'),
(302, 532, 1409145389, 0, 20, 'Не се &quot;ерча&quot; просто споделих, че не може човек без да ме познава и да знае аз какъв човек съм да определя по едно заглавие дали провалЪТ ми е сугурен или не. Вие пък каквото ми наскочихте заради едно заглавие .. да съм казал някъде, че имам опит с блог? Всеки е започнал от някъде нали, какво да не би вашият 1ви блог или сайт да са били перфектни? Силно се съмнявам. И не ме разбирайте погрешно не се &quot;ерча&quot; на никой просто изказвам мнение. uphero Евала за това, че си директен и казваш нещата в прав текст, точно такъв се стремя да бъда и аз и , да, може и да си на годините на баща ми, но нали за това направих тази тема .. за да събера по-компетентни и опитни мнения, а не да ми се нахвърлят заради някакво си заглавие на тема. С това се надявам да приключа темата, благодаря отново на всички за отговорите, живи и здрави. А за странникът, който определи ей така от раз, че блогът ми ще бъде провал, надявам се да не си прав, но времето ще покаже.'),
(303, 532, 1409145412, 0, 20, 'Виж ти пък може да си първия български блогер милионер  дано '),
(304, 532, 1409145414, 0, 21, 'Имам лошия навик да не премълчавани нищо, тъй съм и офлайн тъй съм и тука. На,някой може и да му пречи ама това положението.\nНещата трябва да се казват с истинските им имена. Не одобрявам хора които само за да се харесат си премълчават.\nА колкото до автора на темата сигур мой съм баща (на години де да не си помислите нещо друго).\nПък и щом пита ще споделя и моето мнение.\nАко,нацели нишатА може да вади повече пари и от EN блог.\nВсичко е въпрос на късмет и внимателно планиране и най вече опит, който явно няма. '),
(305, 532, 1409145422, 0, 20, 'Не бих те съветвал да започваш български блог, освен ако не смяташ да вкарваш пари в реклама или нямаш готова аудитория. Парите тук са в пъти по-малко... а сайтове като на Странникът са рядкост, едва ли и блогът ти ще е на някаква уникална за България тема? Времето в писане на статии и т.н. в блога ти по-добре го вложи в учене на английски и отвори по-късно EN.'),
(306, 532, 1409145426, 0, 21, '\n\n    Не се &quot;ерча&quot; просто споделих, че не може човек без да ме познава и да знае аз какъв човек съм да определя по едно заглавие дали провалЪТ ми е сугурен или не. Вие пък каквото ми наскочихте заради едно заглавие .. да съм казал някъде, че имам опит с блог? Всеки е започнал от някъде нали, какво да не би вашият 1ви блог или сайт да са били перфектни? Силно се съмнявам. И не ме разбирайте погрешно не се &quot;ерча&quot; на никой просто изказвам мнение. uphero Евала за това, че си директен и казваш нещата в прав текст, точно такъв се стремя да бъда и аз и , да, може и да си на годините на баща ми, но нали за това направих тази тема .. за да събера по-компетентни и опитни мнения, а не да ми се нахвърлят заради някакво си заглавие на тема. С това се надявам да приключа темата, благодаря отново на всички за отговорите, живи и здрави. А за странникът, който определи ей така от раз, че блогът ми ще бъде провал, надявам се да не си прав, но времето ще покаже. \n\n'),
(307, 532, 1409145428, 0, 20, 'Е, какви са, няма значение, зарязах ги, защото ми писна да ме крадат. И не само статиите, а цели сайтове са ми крали, от-до. Но въпреки, че съм ги зарязал, се оказва, че все още се класират добре. Но темата не е за мен. Независимо дали става въпрос за En или Bg сайтове, автора трябва да може да пише интересни теми, заглавия, да се отличава от другите, да не е скучен. Иначе няма да може да спечели пари, защото парите идват когато има трафик, а като му е скучен сайта - няма да има трафик.'),
(308, 532, 1409145435, 0, 20, 'Абе във всичко има смисъл, ако имаш идея как да го добуташ до края или да го докараш до едно задоволително ниво, което да ти подсигури добри доходи от реклама. В случая от AdSense. Но ако трябва да бъда честен, смисъла тук е по-малък от този да правиш нещо за чужбина. Има бг сайтове, които са стигнали доста добри нива на печалба от AdSense, но това са големи сайтове с доста трафик. Може би нещо над 10К на ден.'),
(309, 532, 1409145441, 0, 21, 'Не бих те съветвал да започваш български блог, освен ако не смяташ да вкарваш пари в реклама или нямаш готова аудитория. Парите тук са в пъти по-малко... а сайтове като на Странникът са рядкост, едва ли и блогът ти ще е на някаква уникална за България тема? Времето в писане на статии и т.н. в блога ти по-добре го вложи в учене на английски и отвори по-късно EN. '),
(310, 532, 1409145454, 0, 21, 'И на мен Видях че е писал че това му е бил първия сайт и е потръгнал... та мисълта ми беше, че много малко хора могат да се похвалят с това. '),
(311, 532, 1409145465, 0, 21, '\n\n    Е, какви са, няма значение, зарязах ги, защото ми писна да ме крадат. И не само статиите, а цели сайтове са ми крали, от-до. Но въпреки, че съм ги зарязал, се оказва, че все още се класират добре. Но темата не е за мен. Независимо дали става въпрос за En или Bg сайтове, автора трябва да може да пише интересни теми, заглавия, да се отличава от другите, да не е скучен. Иначе няма да може да спечели пари, защото парите идват когато има трафик, а като му е скучен сайта - няма да има трафик. \n\n'),
(312, 532, 1409145473, 0, 21, '\n\n    Абе във всичко има смисъл, ако имаш идея как да го добуташ до края или да го докараш до едно задоволително ниво, което да ти подсигури добри доходи от реклама. В случая от AdSense. Но ако трябва да бъда честен, смисъла тук е по-малък от този да правиш нещо за чужбина. Има бг сайтове, които са стигнали доста добри нива на печалба от AdSense, но това са големи сайтове с доста трафик. Може би нещо над 10К на ден. \n\n'),
(313, 532, 1409145490, 0, 20, 'Продавам списък с работещи руски блог платформи, конструктори с осигурен безплатен хостинг и няколко сайта които осигуряват такъв. Всички са подбирани преди няколко дни и са действащи. Подходящи са за сателитки на български език както и руски. Doffolow са и са с ПР от 1 до 9. Общо са 26 на брой. Цена 3 долара за новобранци и 2 доларa за всеки потребител с над 100 мнения във форума. Плащане само PayPal. След заплащане от ваша страна файла се изпраща на посочения емайл.'),
(314, 532, 1409145493, 0, 21, ' Сърдиш се, че сме ти &quot;скочили&quot; - напротив, само си казахме мнението. А то е на базата на това, което виждаме. Дай си сметка - насочил си се да печелиш в сфера, в която заглавието продава (това съвсем не е клише!), а не можеш да направиш едно заглавие за една от най-важните ти теми! Знаеш ли колко такива теми има като твоята? С какво твоята тема е по-различна от другите?'),
(315, 532, 1409145511, 0, 21, ' Сърдиш се, че сме ти &quot;скочили&quot; - напротив, само си казахме мнението. А то е на базата на това, което виждаме. Дай си сметка - насочил си се да печелиш в сфера, в която заглавието продава (това съвсем не е клише!), а не можеш да направиш едно заглавие за една от най-важните ти теми! Знаеш ли колко такива теми има като твоята? С какво твоята тема е по-различна от другите?'),
(316, 532, 1409145519, 0, 20, 'много се извинявам че не пиша по темата но неможах да намера тема сварзана с моя проблем.имам одебрение от googleAdSense ,но ми дава да сложа само търсачката \nдругите реклами не ми дава и ми показва ( To make script tags using the &quot;src&quot; attribute work correctly when using the HTML module, defer=&quot;defer&quot; has been added after the URL. ако някой има нещо в предвид да пише '),
(317, 532, 1409145548, 0, 20, 'Държа да кажа, че много мнения изчетох, даже питах хора, които ползват вестър унион, като опция за получаване на парите си от адсенсе и всеки ми казва различно. Едни казват от 1-ви до 10-ти се получава кода, други казват между 15-сти и 16-сти, от трети чувам между 23-ти и 24-ти. Kакто се досещате, предстои ми първо плащане, въвел съм пин кода и сега чакам ... Може ли някой да се включи в нещата и да ми обясни ? =)\nблагодаря предварително'),
(318, 532, 1409145555, 0, 20, 'На 21-ви ми пускат кода последните няколко месеца. Иначе около 23/24 последните 5 години ....'),
(319, 532, 1409145570, 0, 20, 'Едно време ти изписваше на коя дата ще е излезне кода. Сега с тея промени... с всеки ъпдейт по дизайна и на аналитика и на адсенс нещата им стават все по трудни да се намерят кое къде е. Да, веднъж свикнеш ли си по-добре, смисъл, дава се повече информация, но все пак прехода е труден.\n\nAnyway, и при мен на 21во число изкарват кода.'),
(320, 532, 1409145576, 0, 20, 'Днес е денят, статистиката ми се рестартира след 20 минути. Понеже съм под напрежение дали ще си получа уестърн унион кода, ме интересува дали това нещо става, когато се рестартира статистиката или по всяко време от деня може да се появи кода ? С други думи има ли фиксирано време ?'),
(321, 532, 1409145582, 0, 20, 'Не са толкова точни нещата, няма точна дата и час за плащане. По принцип официално е до 31, но май досега не съм стигал до тази дата. Най късно до 25-ти приключват нещата. Забелязал съм също, че събота и неделя не излизат плащания. Гледай в профила, първо трябва да ти излезе плащане в процес и чак 24 след това ще ти излезе и UW кода.\n\nОтделно проверката на отчетените кликове приключва до 10-ти на текущия месец. В тази връзка съм на 99% обеден, че ще си получиш плащането.\n\nКато излезе моето плащане ще ти пиша да свериш.'),
(322, 532, 1409145589, 0, 20, 'Човека най-учтиво ме помоли и аз да напиша нещо, защото се притеснява за плащането си и иска да знае по-точно. Не съм искал да повтарям казаното от теб Явно за различните профили е различно, аз след 23-24 не съм получавал плащане от години.\n\n\nВенци, аз имам плащане от тази сутрин, така че можеш да провериш как е при теб. Както виждаш обаче за всеки е различно. От тука на татък всеки ден може да излезе. И това плащане в процес явно вече е отпаднало, защото на мен направо ми излезе.'),
(323, 532, 1409145599, 0, 20, 'Малко далеч от темата, мен нещо с тоя adsense не ми се получават работите, от 2010 ми е профила, активирал съм кода, всичко е 6+ за 3 години май имам 40 евро  \nНякой колега ако може да даде малко идей как да вдигна нивото, много ще се радвам, че чак ще почерпя!'),
(324, 532, 1409145640, 0, 20, 'Да, благодаря, махнах я. \nМоже би защото ми е първо плащане и за това ме бавят :S'),
(325, 531, 1409146201, 0, 20, 'нов отгово'),
(326, 531, 1409146271, 0, 25, 'Нема начин!'),
